import React from "react";
import { Typography, AppBar, Link, Menu, Grid, Toolbar, Container, Tabs, Tab, Box, IconButton, Button } from '@material-ui/core'

import ParticipantFilter from './ParticipantFilter';
import ParticipantList from './ParticipantList'
import ResponsiveAppBar from "./component/AppBar";
import useStyles from "./styles";

const App = () => {
    const cards = [1,2,3,4,5,6,7,8,9]
    const pages = ['Start page', 'Participant overview', 'Blog'];
    const classes = useStyles();

    const [anchorElNav, setAnchorElNav] = React.useState(null);

    const handleCloseNavMenu = () => {
        setAnchorElNav(null);
      };

    return (
        <Grid container spacing={2} direction="row" >
            <Grid item xs={12}>
                <AppBar position="static">
                    <Container maxWidth="xl">
                    <Toolbar disableGutters color="default">
                        <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
                        <Menu
                            id="menu-appbar"
                            anchorEl={anchorElNav}
                            anchorOrigin={{
                            vertical: 'bottom',
                            horizontal: 'left',
                            }}
                        >
                        </Menu>
                        </Box>
                        <Box sx={{ display: { xs: 'none', sm: 'block' } }}>
                            {pages.map((item) => (
                                <Button key={item} sx={{ color: '#fff' }}>
                                    {item}
                                </Button>
                            ))}
                        </Box>
                    </Toolbar>
                    </Container>
                </AppBar>
            </Grid>
            <Grid item xs={12}>
                <Box>
                <footer className={classes.footer}>
                    <Typography variant='h6' align="center">
                        Footer
                    </Typography>
                    <Typography variant="subtitle1" align="center" color="textSecondary">
                        To give the footer a purpose
                    </Typography>
                </footer>
                </Box>
            </Grid>
        </Grid>
    );
}
export default App;
